import React from "react";
import "./Header.css"; // Importa un archivo CSS externo para los estilos

const Header = () => {
  return (
    <header className="header">
      <h1 className="logo">Mi Sitio Web</h1>
      <nav className="nav">
        <ul>
          <li>
            <a href="/">Inicio</a>
          </li>
          <li>
            <a href="/login">Acerca de</a>
          </li>
          <li>
            <a href="/form">Servicios</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
